from requests import get
from google.transit import gtfs_realtime_pb2

def ottieni_gtfs():
    url = "http://percorsieorari.gtt.to.it/das_gtfsrt/alerts.aspx"
    try:
        risposta = get(url)
        feed = gtfs_realtime_pb2.FeedMessage()
        feed.ParseFromString(risposta.content)
        return [feed]
    except Exception:
        return []

def avvisi_gtfs(dati, fermata):
    avvisi = [] 
    try:
        codice = codici.get(int(fermata))
        for entity in dati[0].entity:
            alert = entity.alert
            for ente in alert.informed_entity:
                if ente.stop_id == str(codice):
                    titolo = alert.header_text.translation[0].text if alert.header_text.translation else "N/A"
                    descrizione = alert.description_text.translation[0].text if alert.description_text.translation else "N/A"
                    avviso = {
                        "titolo": titolo,
                        "descrizione": descrizione,
                    }
                    avvisi.append(avviso)
        return avvisi
    except Exception:
        return []

